/*Database Design - Explore the Employee_Payroll_2023 Excel dataset - Activity*/

DROP DATABASE IF EXISTS Payroll;
CREATE DATABASE Payroll;
USE Payroll;

Create Table Department (
Department_ID int not null auto_increment,
Department_NO int null,
Department_Title char(100) null,
PRIMARY KEY (Department_ID)
);

Create Table Employee (
Employee_NO int not null,
Gender char(15) null,
Ethnicity char(35) null,
Employment_Type char(30) null,
Department_ID int null,
PRIMARY KEY (Employee_NO),
FOREIGN KEY (Department_ID) REFERENCES department (Department_ID)
);

Create Table Payment (
Payment_ID int not null auto_increment,
Pay_Year year null,
RegulaR_Pay int null,
Overtime_Pay int null,
All_Other_Pay int null,
Total_Pay int null,
Benefit_Pay int null,
City_Retirement_Contributions int null,
Employee_NO int not null,
PRIMARY KEY (Payment_ID),
FOREIGN KEY (Employee_NO) REFERENCES Employee (Employee_NO)
);

Create Table Job (
Job_ID int not null auto_increment,
Job_Title char(100) null,
Job_Status char(50) null,
Job_Class_Pgrade character (10) null,
Employee_NO int not null,
PRIMARY KEY (Job_ID),
FOREIGN KEY (Employee_NO) REFERENCES Employee(Employee_NO)
);

    
    
    
